import React, {useState} from 'react'; 


//Import Components
import Current from './components/Current';

function App() {
  let [zipCode, setZipCode] = useState(""); 

  if (zipCode.length === 5) {
    return (
     <Current zipCode={zipCode} />
    )
  } else {
  return (
  <React.Fragment>
    <div className='weatherApp'>Weather App <img src="./images/sun.png" alt="logo" /></div>
    <div className="zipCode">
      <h3>Enter Your Zipcode: <input 
                        id="zipCode" 
                        name="zipCode" 
                        type="text" 
                        value={zipCode}
                        onChange={(e) => setZipCode(e.target.value)} /></h3>  
    </div>
    </React.Fragment>
  );
  }
}

export default App;
